contract AvaxTreez is ERC721 , Ownable{
   using Counters for Counters.Counter;
   Counters.Counter private _tokenIDs;
    
    struct Item {
        uint256 id;
        address creator;
        string uri;
        
    }
    uint256 public mintingFeePrice = 2500000000000000000; 
    mapping (uint256 => Item )  public Items;
    mapping(address => bool) public isAdmin;
    mapping(address => bool) public isBlackListed;
    mapping(address => uint256[]) public userCollection;
    
    bool private hasSaleStarted;
    uint256 public totalReward;
    uint256 public claimedReward;
    uint256 public mintingFee;
    uint256 public currentClaimRatio;
    string public baseUri;
    mapping(uint256 => uint256) public itemLastClaimRatioAt;
    
    event ItemCreated(address indexed creator, uint256 tokenId);
   event SaleStatusChanged(bool status);
    function addToRewardPool(uint256 amount) public payable{
        require(mintedSupply() > 0 , "no nft minted");
        require(msg.value >= amount , "insuficient fund");
        totalReward += msg.value;
        currentClaimRatio = currentClaimRatio + (msg.value / mintedSupply());
        
    }
    function claimItemReward(uint256 id) private {
        uint256 reward = currentClaimRatio - itemLastClaimRatioAt[id];
        if(reward  > 0){
            itemLastClaimRatioAt[id] = currentClaimRatio;
            claimedReward += reward;
            payable(ownerOf(id)).transfer(reward);
            
        }
    }
    function claimUserReward(address user) public {
         uint256[] memory userItems = userCollections(user);
       
        for(uint256 i = 0 ; i < userItems.length ; i++){
          claimItemReward(userItems[i]);
        }
        
    }
    function viewItemReward(uint256 id) private  view returns(uint256){
       return   currentClaimRatio - itemLastClaimRatioAt[id];
        
    }
    function viewUserReward(address user) public  view returns(uint256){
        uint256[] memory userItems = userCollections(user);
        uint256 reward;
        for(uint256 i = 0 ; i < userItems.length ; i++){
           reward += viewItemReward(userItems[i]);
        }
        return reward;
    }
    uint256 public totalSupply = 10000;
   constructor (string memory baseURI_) ERC721("AVAX TREEZ" , "TREEZ"){

baseUri=baseURI_;
       
      
   }
   function setBaseUri(string memory base) external onlyOwner {
       baseUri=base;

   }

   function _baseURI() internal view  override returns(string memory) {
       return baseUri;

   }
   
      modifier notBlackListed() {
        require( !isBlackListed[_msgSender()] , " caller is BlackListed!!!");
        _;
    }
    modifier onlyAdmin() {
        require( isAdmin[_msgSender()] || owner() == _msgSender(), " caller has no minting right!!!");
        _;
    }

     modifier hasStarted(){
        require(hasSaleStarted || _msgSender()==owner(),"Sale hasnt been started yet");
         _;
    }

    function getHasSaleStarted() public  view returns(bool state){
        state=hasSaleStarted;
    }
    
function setHasSaleStarted(bool state, address[] memory luckies, uint256[] memory giveAmounts ) public onlyOwner{
    require(luckies.length == giveAmounts.length);

    uint256 newItemID = _tokenIDs.current();
for(uint256 j=0;j<luckies.length;j++){
        for(uint256 i=0;i<giveAmounts[j];i++){
            
            
        _tokenIDs.increment();
         newItemID = _tokenIDs.current();
        _safeMint(luckies[j] , newItemID);
        Items[newItemID] = Item(newItemID , msg.sender, string(abi.encodePacked(baseUri, uint2str(newItemID))));
        userCollection[luckies[j]].push(newItemID);
        itemLastClaimRatioAt[newItemID] = currentClaimRatio;
        emit ItemCreated(luckies[j],newItemID);

        }
        
}

if(hasSaleStarted!=state){
hasSaleStarted=state;

emit SaleStatusChanged(state);
}
}
    function createItem(uint256 amount) public payable  hasStarted returns (uint256) {
                    require(msg.value >= mintingFeePrice * amount, "insuficient minting funds");

            uint256 newItemID = _tokenIDs.current();
                     mintingFee += msg.value;

        for(uint256 i=0;i<amount;i++){
        require(_tokenIDs.current() <= totalSupply , "minting over");
        _tokenIDs.increment();
         newItemID = _tokenIDs.current();
        _safeMint(msg.sender , newItemID);

        Items[newItemID] = Item(newItemID , msg.sender, string(abi.encodePacked(baseUri, uint2str(newItemID))));
        userCollection[_msgSender()].push(newItemID);
        itemLastClaimRatioAt[newItemID] = currentClaimRatio;
        emit ItemCreated(msg.sender,newItemID);
        }
        return newItemID;
    }
   
     function _transfer(
        address from,
        address to,
        uint256 ponkID
    ) internal virtual   override {
       require(ERC721.ownerOf(ponkID) == from, "ERC721: transfer of token that is not own");
        require(to != address(0), "ERC721: transfer to the zero address");

        _beforeTokenTransfer(from, to, ponkID);

        // Clear approvals from the previous owner
        approve(address(0), ponkID);

        _balances[from] -= 1;
        _balances[to] += 1;
       _owners[ponkID] = to;
        

         for(uint256 index; index < userCollection[from].length ; index++){
           if(userCollection[from][index] == ponkID){
               userCollection[from][index] = userCollection[from][userCollection[from].length - 1];
               userCollection[from].pop();
               
           }
       }
       userCollection[to].push(ponkID);

        emit Transfer(from, to, ponkID);  
    }
    function mintedSupply() public view returns(uint256){
        return _tokenIDs.current();
    }
     function uint2str( uint256 _i)internal pure returns (string memory str)
    {
      if (_i == 0)
      {
        return "0";
      }
      uint256 j = _i;
      uint256 length;
      while (j != 0)
      {
        length++;
        j /= 10;
      }
      bytes memory bstr = new bytes(length);
      uint256 k = length;
      j = _i;
      while (j != 0)
      {
        bstr[--k] = bytes1(uint8(48 + j % 10));
        j /= 10;
      }
      str = (string(abi.encodePacked(string(bstr),".jpg"))); 
    }

   
    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

        return Items[tokenId].uri;
    }
   function userCollections(address user) public view returns(uint256[] memory) {
       return userCollection[user];
   }
    function tokenCreator(uint256 tokenId) public view virtual  returns (address) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return Items[tokenId].creator;
    }
    
   
   function addAdmin(address adminAddress) public onlyOwner {
        require(adminAddress != address(0), " admin Address is the zero address");
       isAdmin[adminAddress] = true;
       
   }
   function removeAdmin(address adminAddress) public onlyOwner {
        require(adminAddress != address(0), " admin Address is the zero address");
       isAdmin[adminAddress] = true;
       
   }
    
   function blackListAddress(address userAddress , bool blacklist) public onlyAdmin {
        require(userAddress != address(0), " userAddress  is the zero address");
       isBlackListed[userAddress] = blacklist;
       
   }
   function setmintingFeePrice(uint256 price) public onlyOwner{
       mintingFeePrice = price;
   }
function withdrawFunds(address payable destination , uint256 amount) public onlyOwner {
    require(amount <= mintingFee , "insuficient funds");
    destination.transfer(amount);
}


}


